import Meta from "./Meta";
import Header from "./Header";
import Footer from "./Footer";

const Layout = props => (
  <>
    <Meta />
    <Header />
    <main>{props.children}</main>
    <Footer />
    <style jsx>{`
      main {
        flex: 1;
        margin: 1rem;
        background: #143a54;
        max-width: 1200px;
        margin: 0 auto;
      }
    `}</style>
  </>
);

export default Layout;
